import styled from "styled-components";
import { ArrowLeftOutlined } from '@material-ui/icons';


const Container = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
`;

const Slider = () => {
  return (
    <Container>
      <Arrow>
        <ArrowLeftOutlined/>
      </Arrow>
      <Arrow>
        <ArrowRightOutlined/>
      </Arrow>
    </Container>
  )
}

export default Slider
